Page({ data: { information: [] }, checkout: function () { wx.navigateTo({ url: "../checkout/checkout" }) }, onLoad: function (a) { var t = this, o = getApp(); o.globalData.cart.forEach(function (a) { wx.request({ url:"https://wechat.useritech.com/api/attractions/detail?id=",method:"GET",header:{"X-Api-Key":o.globalData.apiKey,"X-Token":o.globalData.token},data:{id:a},success:function(a){t.setData({information:t.data.information.concat(a.data.data.attractions)})}})})}});